import React, {useContext} from 'react';
import './toggleswitchbar_component.css'
import ToggleSwitchButton from '../toggleswitchbutton/toggleswitchbutton_component.js'
import { AppSearchContext } from '../../context/app/app_search_context';

const { paradigm, setSearchParadigm } = useContext(AppSearchContext);

function ToggleSwitchBar(){
    return (
        <>
        <nav className="toggleswitchbar"> 
        <AppSearchContext.Consumer>
            <div className="toggleswitchbar-container">
            <ul>
                    <li><ToggleSwitchButton className="album-toggle-btn" onclick={setSearchParadigm("Album")}/></li>
                    <li><ToggleSwitchButton className="artist-toggle-btn" onclick={setSearchParadigm("Artist")}/></li>
                    <li><ToggleSwitchButton className="genre-toggle-btn" onclick={setSearchParadigm("Genre")}/></li>
                    <li><ToggleSwitchButton className="Song-toggle-btn" onclick={setSearchParadigm("Song")}/></li>
                </ul>
            </div>
            </AppSearchContext.Consumer>
        </nav>
        </> 
    );
}



export default ToggleSwitchBar;
